webpackJsonp([0xae7765fd6f8ea800],{"./node_modules/json-loader/index.js!./.cache/json/meta-free-code-camps-camperbot.json":function(e,o){e.exports={data:{markdownRemark:{html:"<p>Hi, I’m <strong><a href='https://github.com/FreeCodeCamp/freecodecamp/wiki/camperbot' target='_blank' rel='nofollow'>CamperBot</a></strong>! I can help you in this chatroom <img src=\"//forum.freecodecamp.com/images/emoji/emoji_one/smile.png?v=2\" title=\":smile:\" alt=\":smile:\" class=\"forum-image\"></p>\n<h3>Basic Commands:</h3>\n<ul>\n<li><code>find TOPIC</code> find all entries about topic. e.g. <code>find js</code></li>\n<li><code>wiki TOPIC</code> show contents of topic page</li>\n<li><code>thanks @username</code> send brownie points to another user</li>\n<li><code>about @username</code> shows info on that user</li>\n<li><code>Algorithm BONFIRENAME</code> info on a Algorithm</li>\n</ul>\n<p>meet CamperBot in <a href='https://img.shields.io/badge/Gitter_Chat_Room:-FreeCodeCamp/camperbotPlayground_%E2%86%91-006400.svg?style=flat-square&maxAge=2592000%29.svg' target='_blank' rel='nofollow'><img src=\"https://gitter.im/FreeCodeCamp/camperbotPlayground\" alt=\"FreeCodeCamp/camperbotPlayground</a>\"></p>\n<h2>Example Commands</h2>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-none\"><code>find js   # all JS entries\nwiki muta  # first entry with muta in name\nwiki bobbytables  # showing images\nwiki video  # and video\nrollem    # secret sauce\nAlgorithm roman   # any Algorithm with roman in name</code></pre>\n      </div>\n<p>For playing with CamperBot please use the testing channel: <a href='https://gitter.im/FreeCodeCamp/camperbotPlayground' target='_blank' rel='nofollow'>https://gitter.im/FreeCodeCamp/camperbotPlayground</a></p>\n<h2>Help on Algorithms</h2>\n<p>Live currently on the HelpBonFires channel on Gitter <a href='https://gitter.im/FreeCodeCamp/HelpBonfires' target='_blank' rel='nofollow'>https://gitter.im/FreeCodeCamp/HelpBonfires</a></p>\n<p>We’ve added some Algorithm specific commands. If you type <code>Algorithm $BONFIRENAME</code> (where $BONFIRENAME is part of a Algorithm name) it will set the chat to be about that Algorithm. Then you can use some other Algorithm specific commands:</p>\n<ul>\n<li>bf details - more info</li>\n<li>bf spoiler - show some hints</li>\n</ul>\n<h2>More commands</h2>\n<ul>\n<li><code>update</code> pulls new wiki edits asap</li>\n<li><code>topics</code> selected pages from the wiki</li>\n<li><code>rooms</code> all rooms the bot is in</li>\n<li><code>archives</code> show history</li>\n<li><code>music</code> deprecated, plug DJ no longer exists.</li>\n<li><code>twitch</code> show the twitch feed</li>\n</ul>\n<h2>Content for the wiki</h2>\n<p>Feel free to make new pages, an example entry is here: <a href='https://github.com/FreeCodeCamp/freecodecamp/wiki/example' target='_blank' rel='nofollow'>https://github.com/FreeCodeCamp/freecodecamp/wiki/example</a></p>\n<h2>Source Repository</h2>\n<p><code>https://github.com/FreeCodeCamp/camperbot</code></p>\n<p>Fork it and have fun!</p>\n<h2>Roadmap</h2>\n<p>We’re looking for ideas for new features to add, and some people to help working on the bot. Have a look at Tickets with <a href='https://github.com/FreeCodeCamp/camperbot/issues?q=is%3Aopen+is%3Aissue+label%3A%22help+wanted%22' target='_blank' rel='nofollow'>help wanted</a> on the repo and maybe you can contribute?</p>\n<p>In future, we’re planning:</p>\n<ul>\n<li>Algorithm step-by-step tutorials will be available via chat and from the CamperBot</li>\n<li>realtime tagging and searching of chats by topic</li>\n<li>a scripting language and natural language processing Get involved and let us know what you’d like to see next!</li>\n</ul>\n<h2>Developer Chatroom</h2>\n<ul>\n<li><a href='https://gitter.im/FreeCodeCamp/camperbot' target='_blank' rel='nofollow'>Join us on our repository chat room</a> to discuss new features. Perhaps we can pair up to work on the bot 2.0!</li>\n<li><a href='https://gitter.im/FreeCodeCamp/camperbotPlayground' target='_blank' rel='nofollow'>Join this chat room</a> to mess around with the CamperBot and try out commands, proofread your edits to wiki content etc.</li>\n</ul>\n<p><img src=\"https://avatars1.githubusercontent.com/camperbot?&#x26;s=100\" alt=\"enjoy\">Happy Coding!</p>",fields:{slug:"/meta/free-code-camps-camperbot/"},frontmatter:{title:"Free Code Camps Camperbot"}}},pathContext:{slug:"/meta/free-code-camps-camperbot/"}}}});
